import React from "react";
import "./FilterBar.css";

const FilterBar = ({ onFilter }) => {
  return (
    <div className="filter-bar">
      <label>
        <input type="radio" name="filter" value="all" onClick={() => onFilter("all")} />
        Support
      </label>
      <label>
        <input type="radio" name="filter" value="heavy" onClick={() => onFilter("heavy")} />
        Medic
      </label>
      <label>
        <input type="radio" name="filter" value="light" onClick={() => onFilter("light")} />

      </label>
    </div>
  );
};

export default FilterBar;
